void scoreboard(int player1, int player2) {
	volatile int * HEX3_HEX0_ptr = (int *)HEX3_HEX0_BASE;
	volatile int * HEX5_HEX4_ptr = (int *)HEX5_HEX4_BASE;
	// find ones and tens digits of each player
	int player1_d1 = player1 - ((player1 / 10) * 10);
	int player1_d2 = (player1 / 10);
	int player2_d1 = player2 - ((player2 / 10) * 10);
	int player2_d2 = (player2 / 10);
	
	/********* VARIABLES FOR HEX DISPLAY DECODER **********/
	unsigned char seven_seg_decode_table[] = {
		0x3F, 0x06, 0x5B, 0x4F, 0x66, 0x6D, 0x7D, 0x07, 0x7F, 0x67};
	unsigned char hex_segs[] = {seven_seg_decode_table[player2_d1], 
								seven_seg_decode_table[player2_d2], 
								0x00, 0x00, 
								seven_seg_decode_table[player1_d1], 
								seven_seg_decode_table[player1_d2], 
								0x00, 0x00};
	/******************************************************/
	// display onto the first two and last two hex displays
	*(HEX3_HEX0_ptr) = *(int *)(hex_segs);
	*(HEX5_HEX4_ptr) = *(int *)(hex_segs + 4);
}

int PS2_Player(char b1, char b2, char b3) {
	unsigned int nibble[] = {0, 0, 0, 0, 0, 0, 0, 0};
	unsigned int shift_buffer; 
	int i;
	
	shift_buffer = (b1 << 16) | (b2 << 8) | b3;
	for (i = 0; i < 6; ++i) {
		nibble[i] = shift_buffer & 0x0000000F; // character is in rightmost nibble
		shift_buffer = shift_buffer >> 4;
	}
	
	//PLAYER 1 CONTROLS
	if(nibble[5] == 2 && nibble[4] == 3 && nibble[3] == 15 && nibble[2] == 0) // Right (D)
		return 1;
	else if(nibble[5] == 1 && nibble[4] == 12 && nibble[3] == 15 && nibble[2] == 0) // Left (A)
		return 2;
	else if(nibble[5] == 1 && nibble[4] == 11 && nibble[3] == 15 && nibble[2] == 0) // Shoot (S)
		return 3;
	//PLAYER 2 CONTROLS
	else if(nibble[5] == 4 && nibble[4] == 11 && nibble[3] == 15 && nibble[2] == 0) // Right (L)
		return 4;
	else if(nibble[5] == 3 && nibble[4] == 11 && nibble[3] == 15 && nibble[2] == 0) // Left (J)
		return 5;
	else if(nibble[5] == 4 && nibble[4] == 2 && nibble[3] == 15 && nibble[2] == 0) // Shoot (K)
		return 6;
		
	else return 0;
}

void draw_ship(int x_start, int y_start) {
    int i = 0, j = y_start;
    for (int k = 0; k < 25 * 2 * 25 - 1; k += 2) {
        int red = ((spaceship[k + 1] & 0xF8) >> 3) << 11;
        int green = (((spaceship[k] & 0xE0) >> 5)) | ((spaceship[k + 1] & 0x7) << 3);
        int blue = (spaceship[k] & 0x1f);
        short int p = red | ((green << 5) | blue);
        plot_pixel(x_start + i, j, p);
        i += 1;
        if (i == 25) {
            i = 0;
            j += 1;
        }
    }
	
}




